import React from "react";
import Typical from "react-typical";
import "./Profile.css";

export default function Profile() {
  return (
    <div className="profile-container">
      <div className="profile-parent">
        <div className="profile-picture"></div>
        <div className="profile-details">
          <div className="colz">
            <div className="colz-icon">
              {/* Here to add media api link*/}
              {/* <a href="#">
                <i className="fa fa-twitter"></i>
              </a> */}
            </div>
            {/* need to implement some media api? */}
          </div>
          <div className="profile-details-role">
            <span className="primary-text">
              {""}
              <h1>
                {""}
                <Typical
                  loop={Infinity}
                  steps={[

                    "Trusted AI",
                    1000,
                    "Efficient AI",
                    2000,
                    "Data Economy",
                    2000,
                    "Secure Machine Learning",
                    2000,
                    "Healthcare",
                    2000,
                  ]}
                />
              </h1>
              <div className="profile-details-name">
                <span className="primary-text">
                  {""}
                  About
                </span>
              </div>
              <span className="profile-role-tagline">
                Welcom to UBC Trusted and Efficient AI (TEA) lab. AI is emerging technique that supports human decision making. To brodent the deployment AI in our daily life, it must be trustworthy and efficient. However, deep AI models typically contain more than millions of parameters and are viewed as black-box. Our research lies in the topics on enhancing explainablity, fairness, privacy, efficiency and sustainability of AI models, and buiding transparent and safe data eco-systems. We are developing novel machine learning theories, algorithms guided by those principles and aspirations, then translating them to realworld applications.  </span>
            </span>
          </div>
        </div>
      </div>
    </div>
  );
}
